sap.ui.define(["sap/ui/core/format/DateFormat"],function(t){"use strict";return{formatDate:function(t){const e=t=>t.toString().padStart(2,"0");if(!t){return""}const r=e(t.getDate());const o=e(t.getMonth()+1);const n=t.getFullYear().toString().slice(-2);const s=e(t.getHours());const a=e(t.getMinutes());const u=e(t.getSeconds());return`${r}-${o}-${n} ${s}:${a}:${u}`},Delete:function(t){if(t==="X"){return"Deleted"}else if(t===null||t===undefined||t===""){return""}return t},ProviderCategorydes:function(t){if(t=="I+"){return"I+ :Approved Contractors for Projects with values equal to or greater than US$200MM"}else if(t=="I"){return"I: Approved Contractors for Projects with values more than US$140MM and less than US$200MM"}else if(t=="II"){return"III: Approved Contractors for Projects with values more than US$80MM and less than US$140MM"}else if(t=="III"){return"IV:Approved Contractors for Projects with values more than US$40MM up to US$80MM"}else{return""}}}});